  const [state, dispatch] = useReducer(reducer, initialState)
  useEffect(()=>{
    try{
      fetch("http://localhost:9000/questions")
      .then((res)=>res.json()).then((data)=> dispatch({type: "dataReceived", payload: data}))
    }
    catch(e){
      console.log(e)
    }
  }, [])
  return(
    <div className="app">
      <Header/>
      <Main>{state.questions}</Main>
      </div>
  )

}
